INSERT INTO care_encounter_notes VALUES (101, 2004000000, 13, 'cognome=Immè#nome=Francesco#nato=#provincia=#il=1976-03-12#eta=#residente=Roma#indirizzo=Via Mesopotamia#pr=#telefono=#sport=#specialita=#anni=#societa=#consultazione=Controllo#familiare=jhfugfkvjhvb#alimentazione=regolare#digestione=non regolare#caffe=3 al giorno#alcolici=birra raramente#fumo=10 sigarette al giorno massimo#alvo=non ottimale#diuresi=non la fa se non gli fai psst psst#ciclo=regolarissimo#riposo=7 ore a notte tranquillw#terapie=prende il cicloviran#farmaci=prende la creatina#preparazione=sta una furia#personale=ti ringrazio della mail.Mi ha fatto davvero molto piacere.Non devi preoccuparti del fatto che in classe ci possano essere delle "restrizioni".Come già ti ho\r\ndetto è giusto che sia così.L\'importante è sapere che su gli amici che tu\r\nritieni tali ci si possa contare.\r\nE a questo punto mi trovo costretta ad aprire una dolorosa parentesi. Se hai\r\nfatto caso alle parole di Marilù ieri sera potevi scorgere una nostra...o\r\nti ringrazio della mail.Mi ha fatto davvero molto piacere.Non devi preoccuparti del fatto che in classe ci possano essere delle "restrizioni".Come già ti ho\r\ndetto è giusto che sia così.L\'importante è sapere che su gli amici che tu\r\nritieni tali ci si possa contare.\r\n#vaccinazioni=tutte le classiche#allergie=ai gatti, ai pollini#generali=buone, anche se appare affaticato#visibili=che schifo!?!?!?le mucose...bleah!!#sottocutaneo=è pieno di capillari sul punto di esplodere#masse=notevoli e robuste, toniche#capo=tondo e normoformato#faringe=faringe faringe faringe faringe#tiroide=tiro tiro tiro tiro tiro ide ide ide ide#torace=c\'ha due metri di torace che me sembra tanto Aiace#respiratorio=è presente e funzionante#cardiovascolare=pompa sangue come se avesse il cuore di un bue#digerente=mangia ed espelle...ce lo avrà???#urogenitale=non so che vuol dire...ah..il pisello???si si..c\'è...#conc_brevi=COVERCIANO (Firenze), 27 maggio 2004 - "Io e Totti siamo i migliori che ci sono". Poche idee ma chiare, a Bobo Vieri non fa difetto l\'autostima. Così nella conferenza di Coverciano mette in cima a tutti la coppia più bella d\'Europa: "Ci sono tante belle coppie gol in questi Europei ma Totti-Vieri è quella che mi piace più di tutte". Quindi meglio di Raul-Morientes, meglio di van Nistelrooy-Makaay, meglio di Trezeguet-Henry: "Mi piacciono molto anche le coppie di Francia, Olanda e Spagna, ma quella che mi piace di più è la nostra. Con Totti c\'è un feeling...\r\n#stampa_temp=Stampa Temporanea#carica=1#colonne=#righe=#encounter_nr=2004000000#appt_nr=320#sess_user_name=Francesco#tipo_esame=#item_code=CO430#', NULL, '320', '640', 0, '', 0, NULL, '2004-05-27', '16:01:59', NULL, 0, 0, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, '', 'Creato da Francesco il 2004-05-27 16:01:59', 'Francesco', 20040528105606, 'Francesco', 20040527160159);
