INSERT INTO care_encounter_notes VALUES (261, 2004000094, 13, 'anamnestica=cacca#accertamenti=---Valutazione clinica generale @:l\'atleta appare in buone/ottime/discrete/scadute condizioni generali  ; non si evidenziano obiettivamente  rilievi patologici degni di nota . La pressione arteriosa e\'           mmHg. \r\n\r\n\r\n---Esame radiografico del torace - telecuore @:assenza di lesioni pleuro parenchimali di apprezzabilita\' radiologica in atto. L\'ombra cardiovascolare e\' nei limiti morfologici e dimensionali della norma.\r\n\r\n---Valutazione antropometrica e della composizione corporea @:l\'atleta        risulta in   normopeso corporeo (kg     ) rispetto alla statura (cm      ) come conferma il valore del BMI (            ) , ma in sovrappeso sia rispetto al peso forma dichiarato,/sia rispetto al peso di categoria  \r\nLa valutazione della composizione corporea  ha messo in evidenza una percentuale di grasso corporeo                                     .                    rispetto all\'eta\' ed alla costituzione fisica ed alla disciplina praticata ( valutazione con metodo plicometrico :            % secondo Durnin e Womersley,           % secondo Sloan e Weir  ;valutazione con metodo   impedenziometrico           %  )  \r\n \r\n---Valutazione cardiologica @:non si evidenzia alcun elemento di rilievo patologico. Nei limiti della norma il tracciato ECG di base e da sforzo (FC base :       b/min,  FC max :       b/min,  PA max :        mmHG,  Rendimento :            Watt / Kg / min , ottimo).\r\nNormale la morfologia e la funzione cardiaca allecocardiogramma 2D Color Doppler ( VS :        mm; spessore max :       mm ) .\r\n\r\n---Indagini di laboratorio @:i valori riscontrati non hanno mostrato alterazioni significative. i valori riscontrati risultano  nei limiti della norma salvo un aumento di\r\nSi consiglia di ripetere tali indagini a breve / distanza di tempo sotto il controllo del proprio medico di fiducia.\r\n\r\n---Valutazione dietologica @: l\'attuale razione alimentare risulta quantitativamente           rispetto alle esigenze metaboliche dell\'atleta e qualitativamente  non / ben  distribuita negli apporti percentuali dei diversi nutrienti. Corretta / Scorretta la ripartizione dell\'energia totale nell\'arco della giornata.\r\nSi allega pertanto regime dietetico personalizzato da adottare con regolarita\'\r\nQuanto dichiarato allindagine dietologica puo\' rimanere invariato soprattutto se latleta si allena con continuita\' ed a ritmi sostenuti.\r\nSi allegano delle indicazioni sia di igiene alimentare, sia specifiche per migliorare lapporto di liquidi e fibre nella giornata\r\nSi consiglia di incrementare lattivita\' fisica prevalentemente aerobica al fine aumentare il dispendio energetico e di migliorare la percentuale di massa grassa oltre che come supporto alla specifica attivita\' sportiva.\r\n\r\n---Valutazione ortopedica @: non si rilevano elementi di rilievo patologico sia in atto sia in esito a pregresse lesioni\r\n\r\n---Valutazione oftalmologica @: il visus naturale e\' di 12/10 in OD e 12/10 in OS. Non si rilevano elementi patologici a livello del segmento anteriore e del fondo \r\n.\r\n\r\n---Valutazione otorinolaringoiatrica  @: lieve deviazione       convessa  del setto nasale. Membrane timpaniche opacate.\r\n \r\n---Valutazione neurologica @: nervi cranici in ordine; forza, sensibilita\', coordinazione motoria e riflessi osteotendinei nella norma.\r\n\r\n---Valutazione ginecologica @:.\r\n\r\n---Esame spirografico @: i volumi polmonari statici risultano buoni in rapporto all\'eta\' ed alla costituzione fisica. Adeguati i volumi dinamici. Flussi espiratori nei limiti della variabilita\' fisiologica.\r\n\r\n---Valutazione pneumologica @:#conclusioni=La validita\' dell\'atleta e\' buona non presentando allo stato attuale controindicazioni alla prosecuzione della specifica attivita\' sportiva.  E\' idoneo alla  qualifica di atleta Probabile Olimpico.\r\nDalle indagini effettuate non emergono controindicazioni alla prosecuzione della specifica attivita\' sportiva.\r\nSi allega regime dietetico personalizzato da adottare con regolarita\'.\r\nDeve tornare a controllo                       entro il mese di            ; se l\'atleta non si presentera\' a tale controllo nei tempi indicati, dovra\' essere considerato automaticamente non idoneo.\r\nDeve effettuare                                 entro breve tempo ed inviarcene i risultati.\r\nDeve attenersi a quanto consigliato in ambito / da#stampa_temp_rel_con=Stampa Temporanea#nr=376#delta=040618#encounter_nr=2004000094#motivoconsult=Valutazione P.O.#carica=#', NULL, 'rel_conc', '2004000094040618', 0, '', 0, NULL, '2004-06-21', '13:25:28', NULL, 0, 0, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, '', 'Creato da Francesco il 2004-06-21 13:25:28', 'Francesco', 20040621132528, 'Francesco', 20040621132528);
