INSERT INTO care_news_article VALUES (1, 'it', 27, '1', 'pending', 'Marco e Francesco sò proprio i mejo!!!', 'Lavorano presso la Fidal', '\r\n', NULL, 'gif', 1, '', '', '', 'Franz', '2004-03-17 16:25:54', '0000-00-00 00:00:00', '2004-03-17', 'Francesco', 20040317162554, 'Francesco', 20040317162554);
INSERT INTO care_news_article VALUES (2, 'it', 27, '1', 'pending', 'Finalmente un bel progetto!!', 'I sistemi informativi hanno affidato a due dei loro migliori uomini, Bernardi ed Immè, il progetto per la fatturazione!', '\r\n', NULL, 'gif', 1, '', '', '', 'Francesco Immè', '2004-03-18 10:46:02', '0000-00-00 00:00:00', '2004-03-18', 'Francesco', 20040318104602, 'Francesco', 20040318104602);
INSERT INTO care_news_article VALUES (3, 'it', 1, '1', 'pending', 'Finalmente inseriamo i dati', 'Evviva', 'Non c\'è una presa della corrente decente', NULL, 'jpg', 1, '', '', '', 'Franz', '2004-05-20 12:36:18', '0000-00-00 00:00:00', '2004-05-20', 'Francesco', 20040520123618, 'Francesco', 20040520123618);
INSERT INTO care_news_article VALUES (4, 'it', 1, '1', 'pending', 'Marco si è finalmente laureato!!!', 'In una delle ultime giornate temperate che questa primavera ci ha regalato Marco Bernardi ha brillantemente discusso la sua tesi di laurea!', '<p>Con un bel lavoro sul single sign on Marco Bernardi finalmente si è scrollato di dosso il peso di 7 anni di studio.</p><p>Improvviso come un colpo di spugna che pulisce una vecchia lavagna, questo giorno fa cadere quelle tensioni che per molto tempo si erano accumulate.</p><p>Emozionato ma risoluto ha affrontato la cosa molto brillantemente, non cadendo neanche in agitazione a causa di una domanda inaspettata, posta da un membro della commissione, che ha offerto uno spunto di dibattito, a cui ha posto fine il prof.Crudele con un lucido intervento.</p>', NULL, 'jpg', 2, '', '', '', 'Francesco', '2004-05-20 14:57:56', '0000-00-00 00:00:00', '2004-05-20', 'Francesco', 20040520145756, 'Francesco', 20040520145756);
INSERT INTO care_news_article VALUES (5, 'it', 1, '1', 'pending', 'E\' arrivato il caldo!!', 'Inizia a fare veramente caldo, e noi non ce la facciamo già più..', '<p>Forse ci stava abituando un pò male con quelle giornate fresche, anche se fastidiosamente varibili.</p><p>Però meglio di questo caldo appiccicoso, che molti romani già conoscono bene, e che odiano cordialmente.</p>', NULL, 'gif', 1, '', '', '', 'Francesco', '2004-05-20 15:03:35', '0000-00-00 00:00:00', '2004-05-20', 'Francesco', 20040520150335, 'Francesco', 20040520150335);
INSERT INTO care_news_article VALUES (6, 'it', 1, '1', 'pending', 'cccc', 'cccc', 'Durante i test avvenuti oggi si è non solo verificata la bontà di tale\r\nfunzione, ma si è migliorata l\'interfaccia con l\'operatore, a cui viene\r\nsubito offerta una indicazione di chi sia il paziente già inserito nel\r\nsistema che ha quello stesso codice fiscale digitato.<br />\r\nIn tale modo si fa sì che dati assicurativi (FONDAMENTALI PER LA\r\nFATTURAZIONE) non si propaghino affatto. L\'operatore deve, in tali\r\nsituazioni, verificare la bontà:<br />\r\n1)del codice fiscale appena inserito<br />\r\n2)dei dati del paziente che ha quel codice fiscale già inserito<br />\r\nNel primo caso DEVE reinserire i dati assicurativi (che il sistema non\r\nha registrato poichè duplicato di dati già esistenti, si blocca così\r\nl\'errore) visto che in realtà non sono stati inseriti; nel secondo caso\r\ncontattare il CED, poichè se il codice del paziente già presente\r\nrisulta sbagliato sono molti i problemi, a partire dal fatto che se\r\ntale paziente ha fatturato la fattura è stata emessa con codice fiscale\r\nerrato. <br />\r\nE\' per questo che rammento di porre la massima attenzione e cura\r\nnell\'inserire tale dato. Pochi secondi in più durante tale operazione\r\nlevano molti futuri possibili problemi.\r\n', NULL, '', 3, '', '', '', 'Francesco', '2004-09-29 10:32:14', '0000-00-00 00:00:00', '2004-09-29', 'Francesco', 20040929103214, 'Francesco', 20040929103214);
